export default class Roles {
    static get values() {
        return{
            admin: 'admin',
            custom: 'custom',
            engineer: 'engineer',
            masterEngineer: 'masterEngineer',
            operator: 'operator',
            analyst: 'analyst'

            // Facility1: 'Объект 1',
            // Facility2: 'Объект 2',
            // TestHangar1: 'Ангар 1',
            // TestHangar2: 'Ангар 2',
            // TestHangar3: 'Ангар 3'
        }
    }

    static labelOf(roleId){
        if(!this.values[roleId]){
            return roleId
        }
        return this.values[roleId];
    }
}
